import routes from './config'
import { Suspense } from "react";
import { BrowserRouter as Router, Switch, Route } from "react-router-dom"

const App = () => {
  return(
    <Router>
      <Switch>
        <Suspense fallback={''}>
          {
            {/* routes.map(item => {
              <Route exact key={ String(item.path) } path={ item.path } component={item.component}></Route>
            }) */}
          }
          <Route exact path="/" component={<div>11111</div>}></Route>
        </Suspense>
      </Switch>
    </Router>
  )
}

export default App;
